import { Helmet } from 'react-helmet-async';
import { Container, Grid, Typography } from '@mui/material';
import Box from '@material-ui';
import ProfileCard from '../components/Profile-card/ProfileCard';

const bidProfileData = {
  title: 'Cleaner',
  duration: '3 hrs',
  price: '900',
  rating:4.4,
  profileImage: 'https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-profiles/avatar-2.webp',
  username: 'Laiba',
  phoneNumber: '1234567890',
};
export default function DashboardAppPage() {
  return (
    <>
      <Helmet>
        <title> Bidding | Helper Buddy </title>
      </Helmet>

      <Container maxWidth="xl">
        <Typography variant="h4" sx={{ mb: 5 }}>
          Hi, Welcome Moiz
        </Typography>
        <Box >
        <Grid container spacing={3}>
          {Array.from(Array(6)).map((_, index) => (
            <Grid item xs={12} justifyContent="space-between" sm={12} md={6} lg={6} xl={6} key={index}>
              <ProfileCard data={bidProfileData} />
            </Grid>
          ))}
        </Grid>
        </Box>
      </Container>
    </>
  );
}
